import React from 'react';
import { motion } from 'framer-motion';

const Stats = ({ activities }) => {


  return (
    <div className="min-h-screen" style={{backgroundColor: 'rgb(255, 254, 247)',
    padding: '2.5rem',}}>
      <h1 className="text-4xl font-bold mb-8">
        how you're doing in{' '}
        <motion.span
          initial={{ opacity: 0, y: -50 }}
          animate={{ opacity: 1, y: 0 }}
          exit={{ opacity: 0, transition: { duration: 0.5 } }}
          transition={{ type: 'spring', stiffness: 200, damping: 20 }}
          className="inline-block"
        >
          {new Date().getFullYear()}
        </motion.span>
      </h1>

      {activities.map(activity => (
          <li key={activity.id}>
            <p>Distance: {activity.distance} meters</p>
            <p>Average Pace: {activity.average_speed} m/s</p>
            <p>Heart Rate: {activity.average_heartrate}</p>
          </li>
        ))}

    </div>
  );
};

export default Stats;
